%@  set(findobj('Tag','CRPData','Parent',findobj('Parent',hCRP,'Tag','CRPPlot')),'Visible','off')
%@  
%@  % embedding vectors
%@
%@  i=(1:NX)';j=0:t:0+(m-1)*t;
%@  i=reshape(i(:,ones(1,m))+j(ones(NX,1),:),m*NX,1);
