%@          if (size(Matrix,1) > size(VarValue,1))  
%@             VarValue((size(VarValue,1)+1):size(Matrix,1),:) = NaN;
%@          % Spaltenvektor zu lang
%@          else
%@            Matrix((size(Matrix,1)+1):size(VarValue,1),:) = NaN;
%@          end
%@        end
%@
%@        Matrix = [Matrix VarValue]; 
%@      end
