%@  while h<N(2)-1 & v<N(1)-1 & mflag~=1,
%@   
%@    if nogui==0
%@      if check_stop_LOS(hTP,hTPCtrl,nogui,obj), break, end
%@    end
%@    if nogui~=2
%@      waitbar(h/N(2))
%@    end
%@
%@    dw=1;
%@    
%@    if v < 1, v = 1; end
%@    if h < 1, h = 1; end
%@  
%@    W=X(v:v+dw,h:h+dw);
%@    W(1,1)=0; 
%@
%@    if ~isempty(fixp)
